import React, {Component} from 'react';
import { BrowserRouter, Link, Route } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';
import Home from './Pages/Home';
import SymptomChecker from './Pages/SymptomChecker'
import Dashboard from './Pages/Dashboard'
import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      images: []
  }
  this.addImage = this.addImage.bind(this)
  }
  addImage(image) {
    this.setState({images: [...this.state.images, image]})
  }
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Navbar className="App-Navbar">
            <Navbar.Brand className='App-NavTitle'>Welcome to...</Navbar.Brand>
            <div>
            <Nav>
              <Link className='App-link' to='/'>Home</Link>
              <Link className='App-link' to='/SymptomChecker'>Symptom Checker</Link>
              <Link className='App-link' to='/Dashboard'>COVID-19 Dashboard</Link>
            </Nav>
            </div>
          </Navbar>

          <Route exact path='/' component={(routeProps) => (<Home />)} />
          <Route exact path='/SymptomChecker' component={(routeProps) => (<SymptomChecker />)} />
          <Route exact path='/Dashboard' component={(routeProps) => (<Dashboard />)} />

        </BrowserRouter>
      </div>
    );
  }
}

export default App;
